import React, { useState, useEffect } from 'react';
import { 
  FaTable,
  FaSync,
  FaTimesCircle
} from 'react-icons/fa';
import './App.css';

function App() {
  const [beacons, setBeacons] = useState([]);
  const [loading, setLoading] = useState(true);
  const [lastUpdate, setLastUpdate] = useState(null);

  // Fixed 10 MAC IDs
  const FIXED_MACS = [
    "7dde168bcd1a",
    "c31c357362f6",
    "f3b38a07501c",
    "f5a6092abd48",
    "6c109a3b3acc",
    "1a862c8091e8",
    "6fd8464a0b55",
    "1deec0a765c7",
    "29f8a5042e1d",
    "1cea28dd766d"
  ];

  // Generate random RSSI between -90 and -30
  const randomRSSI = () => Math.floor(Math.random() * (61)) - 90; // -90 to -30

  // Derive status from RSSI (negative scale)
  const getStatusFromRSSI = (rssi) => {
    if (rssi >= -45) return "Active";     // Strong signal
    if (rssi >= -70) return "Warning";    // Medium
    return "Critical";                    // Weak
  };

  // Create simulated beacon data
  const generateBeacons = () => {
    return FIXED_MACS.map((mac) => {
      const rssi = randomRSSI();
      return {
        mac_address: mac,
        beacon_rssi: rssi,
        last_seen: new Date().toISOString(),
        status: getStatusFromRSSI(rssi)
      };
    });
  };

  // Refresh data every 10 sec
  const fetchData = () => {
    setLoading(true);
    setTimeout(() => {
      setBeacons(generateBeacons());
      setLastUpdate(new Date());
      setLoading(false);
    }, 500);
  };

  useEffect(() => {
    fetchData();
    const interval = setInterval(fetchData, 10000); // 10 sec
    return () => clearInterval(interval);
  }, []);

  // Class styling based on RSSI
  const getSignalStrengthClass = (rssi) => {
    if (rssi >= -45) return 'good';      // Active
    if (rssi >= -70) return 'warning';   // Warning
    return 'critical';                   // Critical
  };

  const getStatusClass = (status) => {
    switch (status?.toLowerCase()) {
      case 'active':
        return 'active';
      case 'warning':
        return 'warning';
      case 'critical':
        return 'critical';
      default:
        return 'active';
    }
  };

  const formatDateTime = (dateString) => {
    if (!dateString) return 'N/A';
    try {
      const date = new Date(dateString);
      return date.toLocaleString();
    } catch {
      return dateString;
    }
  };

  const formatRSSI = (rssi) => {
    if (rssi === null || rssi === undefined) return 'N/A';
    return `${rssi} dBm`;
  };

  return (
    <div className="container">
      <div className="header">
        <h1>LoRaWAN Beacon Monitor</h1>
        {lastUpdate && (
          <p style={{ fontSize: '0.9rem', marginTop: '10px' }}>
            Last updated: {lastUpdate.toLocaleTimeString()}
          </p>
        )}
      </div>

      <div className="info-section">
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
          <h2>
            <FaTable className="icon" />
            Detected Beacons
          </h2>
          <button 
            className="refresh-button" 
            onClick={fetchData}
            disabled={loading}
          >
            <FaSync style={{ marginRight: '5px' }} />
            {loading ? 'Refreshing...' : 'Refresh'}
          </button>
        </div>

        {beacons.length > 0 ? (
          <table className="beacon-table">
            <thead>
              <tr>
                <th>Device</th>
                <th>MAC Address</th>
                <th>Signal Strength</th>
                <th>Last Seen</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {beacons.map((beacon, index) => (
                <tr key={beacon.mac_address}>
                  <td>Beacon #{index + 1}</td>
                  <td>{beacon.mac_address}</td>
                  <td>
                    <span className={`signal-strength ${getSignalStrengthClass(beacon.beacon_rssi)}`}>
                      {formatRSSI(beacon.beacon_rssi)}
                    </span>
                  </td>
                  <td>{formatDateTime(beacon.last_seen)}</td>
                  <td>
                    <span className={`status ${getStatusClass(beacon.status)}`}>
                      {beacon.status}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <div style={{ textAlign: 'center', padding: '40px', color: '#666' }}>
            <FaTimesCircle style={{ fontSize: '3rem', marginBottom: '10px', color: '#ccc' }} />
            <p>No beacon data available</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
